import { StyleSheet } from "react-native";

export default StyleSheet.create({
  mainContainer: {
    flex: 1,
  },
  container: {
    flex: 1,
    justifyContent: "center",
    alignItems: "flex-start",
    marginLeft: 100,
    paddingBottom: 200,
  },
  image: {
    flex: 1,
    width: "100%",
    height: "100%",
  },
  backgroundImage: {
    height: 500,
    width: "100%",
  },
  titleText: {
    fontSize: 70,
  },
  descriptionText: {
    marginTop: 0,
    fontSize: 30,
  },
  canvas: {
    height: 50,
  },
  learnMoreContainer: {
    justifyContent: "flex-end",
    alignItems: "flex-start",
    height: 100,
    backgroundColor: "white",
  },
});
